Імпульсне зарядний пристрій для автомобильного аккумулятора Pulso BC-12610 - это незаменимое устройство, которое поможет "оживить" большинство аккумуляторов (автомобильные, мотоциклетные, лодочные и др.). Подойдет для свинцово-кислотных, гелиевых и AMG аккумуляторов емкостью от 5 до 120 А/ч. Обладает регулировкой тока зарядки от 0 до 10 ампер. Работает в двух режимах с выходным напряжением 6 и 12 вольт. Корпус устройства довольно компактный и надежный, имеет удобную ручку для переноски. На лицевой стороне расположена стрелочная индикация силы тока, кнопка включения и 4 led индикатора отображающих текущее состояния процесса заряда. В подключенном состоянии поддерживается режим непрерывного заряда. Зарядное устройство оснащено многоуровневой защитой от перезаряда, перегрузки, короткого замыкания и неправильного подключения.

PULSO BC-12610 
•Принцип работы: Импульсное
•Тип заряжаемого АКБ: Свинцово-кислотный, Гелевый, AMG
•Входное напряжение и частота: 230-240 В/50Гц; 
•Выходное напряжение: 6/12 В; 
•Ток зарядки: от 0 до 10 А; 
•Подходит для заряда АКБ емкостью: 5-120 А/ч; 
•Мощность 110 Вт
•Непрерывная подзарядка; 
•Буферный режим: есть; 
•Провод питания - 1,7 м; 
•Провод для зарядки - 1,4 м;

ОСОБЕННОСТИ Pulso BC то-12610: 
•Ударопрочный металлический корпус; 
•Стрелочный амперметр; 
•Регулировка силы тока; 
•Защита от перезаряда; 
•Защита от неправильного подключения и замыкания; 
•Защита от перегрева; 
•Импульсный принцип работы продлевает срок службы АКБ.

